import { socialIcons, socialIconsBackgroundColors } from '../constant/icons'

export default {
  name: 'Aviran Levi',
  location: 'Tel Aviv-Yafo, Israel',
  jobTitle: 'Full-Stack Web Developer',
  socialLinks: [
    {
      icon: socialIcons.github,
      name: 'github',
      url: 'https://github.com/AviranLevi',
      style: socialIconsBackgroundColors.github,
    },
    {
      icon: socialIcons.instagram,
      name: 'instagram',
      url: 'https://www.instagram.com/a.be_music/',
      style: socialIconsBackgroundColors.instagram,
    },
    {
      icon: socialIcons.linkedIn,
      name: 'linkedIn',
      url: 'https://www.linkedin.com/in/aviran-levi-29660911b/',
      style: socialIconsBackgroundColors.linkedIn,
    },
  ],
}
